import { StyleSheet } from 'react-native';

export default StyleSheet.create({
  android: {
    padding: 30,
    fontSize: 30,
    textAlign: 'center',
    color: '#0066CC',
    fontWeight: '300',
  },
  ios: {
    paddingTop: 30,
    fontSize: 26,
    textAlign: 'center',
    color: '#0066CC',
    fontWeight: '200',
  },
});
